import './App.css';  
import { useState, useEffect, useContext } from "react";
import { AppContext } from './context';
const [searchText, setSearchText] = useState('');  // <--- New state for search


const Cards = (props) => {
    const {data} = props;
    const{id, cloudinaryImageId,name,cuisines,avgRating,deliveryTime,areaName} = data.info;
    const { isLoggedIn, addToCart } = useContext(AppContext);
    const handleAddToCart = () => {
        if (!isLoggedIn) {
          alert("Please log in to add to cart");
          return;
        }
        addToCart({ id, name, cloudinaryImageId, price: 199 });
      };


    return(
    <div className="cards"> 
            <img src ={"https://media-assets.swiggy.com/swiggy/image/upload/fl_lossy,f_auto,q_auto,w_660/"+cloudinaryImageId}  alt = "icon" className = "deliveryIcons"/>
            <div>
                <h2> {name}</h2>
                <h3><img src ="https://banner2.cleanpng.com/20190605/vep/kisspng-macys-herald-square-logo-royalty-free-image-star-png-vector-clipart-psd-peoplepng-com-5cf8639da90d18.0343359515597823016924.jpg" className = "deliveryIcon" alt ="logo"/>{avgRating}. {deliveryTime}</h3>
                <p>{cuisines}</p>
                <p>{areaName}</p> 
                <button onClick={handleAddToCart}>Add to Cart</button>
            </div>
        </div>
        )

}

const RestaurantCard = ()=> { 
    const [list,setList] = useState([]); 
    const [area,setarea] = useState([]); 

            const fetchData = async () =>{
                const response = await fetch("https://www.swiggy.com/dapi/restaurants/list/v5?lat=23.7956531&lng=86.43038589999999&is-seo-homepage-enabled=true&page_type=DESKTOP_WEB_LISTING");
                const Data = await response.json(); 
                setarea (Data?.data?.cards[2]?.card?.card?.title)
                console.log( Data?.data?.cards[4]?.card?.card?.gridElements?.infoWithStyle?.restaurants)

                setList(Data?.data?.cards[4]?.card?.card?.gridElements?.infoWithStyle?.restaurants)

            }



            useEffect(()=>{ 
            fetchData() 


            },[]) 




    return( 
        <div className="restaurantslist-container"> 
            <h2>{area}</h2>
            <div>
                <ul className = "restaurantslist">
                    <li className ="restaurantslists">Filter</li>
                    <li className ="restaurantslists">Sort By</li> 
                    <li className ="restaurantslists">Rating 4.0+</li> 
                    <li className ="restaurantslists">Fast Delivery</li>
                    <li className ="restaurantslists">Pure Veg</li>
                    <li className ="restaurantslists">Offers</li>
                    <li className ="restaurantslists">Rs 300-600</li>       
                    <li className ="restaurantslists">less than 300</li>
                </ul>
            </div>  

            <div className="cardcontainer">
            {list.map((each) => (<Cards data ={each} key ={each.id}/>))}
            </div>



        </div>  
    )

}  
export default RestaurantCard
